window.bookSummaryJSON = "<p><b>To save the only man she's ever loved, she must pay a price.</b></p> <p>When Dr. Meghan Forester, a young researcher, helps create a vaccine for the deadly Makanza virus, her goal to annihilate the virus is coming true.</p> <p>But the question remains - what becomes of the Kazzies? They'll always be infected carriers of the terrifying virus. Despite being newly vaccinated, the public still believes they'll die if exposed.</p> <p>As government discussions about releasing the Kazzies meets public resistance, a frightening event plunges Meghan into the Kazzie world with Davin at her side. Unwittingly, she becomes the poster child for a political movement to free them. But when an old enemy resurfaces, Meghan learns that to save the only man she's ever loved, she must pay a steep price.</p> <p><b>Recommended order for this series:</b></p> <p><i>The Second Wave</i> - book zero</p> <p><i>Compound 26</i> - book one</p> <p><i>Reservation 1</i> - book two</p> <p><i>Section 12</i> - book three</p> <p><i>Division 5</i> - book four</p> <p>Download <i>Reservation 1</i> now!</p>"; 
